import React from "react";

const App = () => {
  return (
    <div>
      <header>
        <img
          styled={{ width: "131px", heigth: "59px" }}
          src="https://saffroncateringonline.co.uk/wp-content/uploads/2020/05/LogoSaffron.png"
        />
      </header>
    </div>
  );
};
export default App;
